        public Dictionary<byte, int> TileSet
        {
            get { return _tileSet; }
        }

        public Dictionary<byte, int> WallSet
        {
            get { return _wallSet; }
        }

        public Dictionary<byte, short> StyleSet
        {
            get { return _styleSet; }
        }

        public byte[,] Tiles
        {
            get { return _tiles; }
        }

        public byte[,] Slopes
        {
            get { return _slopes; }
        }

        public byte[,] Walls
        {
            get { return _walls; }
        }

        private void GenerateStructure()
        {
            int px = X - (Tiles.GetLength(1) / 2);
            int py = Y + (Tiles.GetLength(0) / 2) + 63;

            for (int x = 0; x < Tiles.GetLength(1); x++)
            {
                for (int y = 0; y < Tiles.GetLength(0); y++)
                {
                    byte tile = Tiles[Tiles.GetLength(0) - 1 - y, x];
                    short style = StyleSet[tile];
                    byte wall = Walls[Tiles.GetLength(0) - 1 - y, x];
                    byte slope = Slopes[Tiles.GetLength(0) - 1 - y, x];

                    if (tile != 1)
                        WorldGen.PlaceTile(px + x, py - 46 - y, TileSet[tile], false, true, -1, style);
                    WorldGen.PlaceWall(px + x, py - 46 - y, WallSet[wall]);

                    Framing.GetTileSafely(px + x, py - 46 - y).slope(slope);
                }
            }

            WorldGen.PlaceTile(px + 46, py - 117 + 19, Decimation.decimation.TileType("ShrineAltar"));
            WorldGen.PlaceTile(px + 150, py - 117 + 19, Decimation.decimation.TileType("ShrineAltar"));
            WorldGen.PlaceObject(px + 60, py - 117 - 16, Decimation.decimation.TileType("LockedShrineDoor"));
            WorldGen.PlaceObject(px + 139, py - 117 - 16, Decimation.decimation.TileType("LockedShrineDoor"));
            WorldGen.PlaceObject(px + 63, py - 117 + 26, Decimation.decimation.TileType("LockedShrineDoor"));
            WorldGen.PlaceObject(px + 135, py - 117 + 26, Decimation.decimation.TileType("LockedShrineDoor"));
            WorldGen.PlaceBanner(px + 53, py - 117 + 21, TileID.Banners, 21);
            WorldGen.PlaceBanner(px + 145, py - 117 + 21, TileID.Banners, 21);
            WorldGen.PlaceBanner(px + 158, py - 117 + 21, TileID.Banners, 21);
            WorldGen.PlaceBanner(px + 40, py - 117 + 21, TileID.Banners, 21);
            WorldGen.PlaceBanner(px + 28, py - 117 - 13, TileID.Banners, 21);
            WorldGen.PlaceBanner(px + 170, py - 117 - 13, TileID.Banners, 21);
            WorldGen.PlaceObject(px + 31, py - 117 + 5, TileID.Tables, false, 13);
            WorldGen.PlaceObject(px + 167, py - 117 + 5, TileID.Tables, false, 13);
            WorldGen.PlaceObject(px + 33, py - 117 + 5, TileID.Chairs, false, 16);
            WorldGen.PlaceObject(px + 165, py - 117 + 5, TileID.Chairs, false, 16, 0, -1, 1);
            WorldGen.PlaceObject(px + 54, py - 117 + 5, 105, false, 49);
            WorldGen.PlaceObject(px + 145, py - 117 + 5, 105, false, 49);
            WorldGen.PlaceObject(px + 39, py - 117 + 19, TileID.Bookcases, false, 4);
            WorldGen.PlaceObject(px + 54, py - 117 + 19, TileID.Bookcases, false, 4);
            WorldGen.PlaceObject(px + 144, py - 117 + 19, TileID.Bookcases, false, 4);
            WorldGen.PlaceObject(px + 159, py - 117 + 19, TileID.Bookcases, false, 4);
            WorldGen.PlaceObject(px + 76, py - 117 + 21, TileID.Painting6X4, false, 14);
            WorldGen.PlaceObject(px + 121, py - 117 + 21, TileID.Painting6X4, false, 14);
            WorldGen.PlaceObject(px + 92, py - 117 + 41, TileID.Painting3X3, false, 30);
            WorldGen.PlaceObject(px + 106, py - 117 + 41, TileID.Painting3X3, false, 30);
        }

        public void Generate()
        {
            X = Main.maxTilesX / 2;

            do
            {
                Y = Main.maxTilesY - 160 + Main.rand.Next(20);
            } while (Y + 160 < Main.maxTilesY);

            a = 120;
            b = 70;
            float c = (float)(Math.Sqrt(Math.Pow(a, 2) - Math.Pow(b, 2))); // Pythagore

            for (int x = -a - 10; x <= a + 10; x++)
            {
                for (int y = -b - 10; y <= b + 10; y++)
                {
                    double d1 = Vector2.Distance(new Vector2(-c, 0), new Vector2(x, y));
                    double d2 = Vector2.Distance(new Vector2(c, 0), new Vector2(x, y));

                    if (d1 + d2 >= 2 * a - 10 && d1 + d2 <= 2 * a + 10)
                    {
                        WorldGen.PlaceTile(X + x, Y + y, Decimation.decimation.TileType("Basalt"), false, true);
                        if (Main.rand.Next(60) == 0)
                            WorldGen.TileRunner(X + x, Y + y, 5, 2, TileID.Obsidian);

                        Framing.GetTileSafely(X + x, Y + y).slope(0);
                    }
                    else if (d1 + d2 < 2 * a - 10)
                    {
                        Framing.GetTileSafely(X + x, Y + y).ClearEverything();
                    }
                }
            }

            GenerateStructure();
        }
    }
}
